import { Component, OnInit, Injectable, ViewChild } from '@angular/core';
import { PagedItems } from '../../view-model/PagedItems';
import { ModalService } from '../../shared/services/modal.service';
import { MessagesService } from '../../shared/services/messages.service';
import { ApplicationService } from '../../shared/services/application.service';
import { ExcelService } from '../../shared/services/excel.service';
import { PDFService } from '../../shared/services/pdf.service';
declare var jsPDF: any; // Important
import { Router } from '@angular/router';
import { AuthGuard } from '../../shared/guards/auth-guard.service';
import { ValidationService } from '../../shared/services/validation.service';
import { Location } from '@angular/common';
import * as html2pdf from 'html2pdf.js';
import { AssignHour } from '../../shared/services/assignHour.service';
import { RelatorioListagemHistoricoInsumosVM } from '../../view-model/RelatorioListagemHistoricoInsumosVM';

@Component({
	selector: 'app-relatorio-listagem-historico-insumos',
	templateUrl: './relatorio-listagem-historico-insumos.component.html'
})

@Injectable()
export class RelatoriListagensHistoricoInsumoComponent implements OnInit {

	formPai = this;
	grid: any = { sort: {} };
	parametros: any = {};
	result: boolean = false;
	servico = 'RelatorioListagemHistoricoInsumos';
	objetoRelatorio : Array<RelatorioListagemHistoricoInsumosVM> = new Array<RelatorioListagemHistoricoInsumosVM>();
	exibeRelatorio: boolean = false;
	arquivoRelatorio: any;
	hashPDF: any;
	linkSource: any;
	downloadLink: any;
	fileName: any;
	filterVm : any = {};
	lista: Array<any>;

	constructor(
		private applicationService: ApplicationService,
		private modal: ModalService,
		private validationService: ValidationService,
		private msg: MessagesService,
		private router: Router,
		private Location: Location,
		private authguard: AuthGuard,
		private assignHour: AssignHour,
		private excelService : ExcelService
	) {}

	toExportFileName(excelFileName: string): string {
		return `${excelFileName}_listagem_${new Date().getTime()}.pdf`;
	}

	ngOnInit(): void {}

	//1 - pdf / 2 - excel
	validar(tpExportacao){

		if(!this.filterVm.nomeEmpresa && !this.filterVm.codigoProduto && !this.filterVm.inscricaoCadastral){
			this.modal.alerta("Informe um filtro para gerar o Relatório!");
			return false;
		}
		if(!this.filterVm.codigoProduto){
			this.modal.alerta("Campo obrigatório não informado: <b>Código do produto</b>!");
			return false;
		}
		if(!this.filterVm.inscricaoCadastral && !this.filterVm.nomeEmpresa){
			this.modal.alerta("Informe a <b>Inscrição Cadastral</b> ou <b>Empresa</b>!");
			return false;
		}

		let obj : RelatorioListagemHistoricoInsumosVM = new RelatorioListagemHistoricoInsumosVM();

		obj.nomeEmpresa = this.filterVm.nomeEmpresa;
		obj.inscricaoCadastral = this.filterVm.inscricaoCadastral ? Number(this.filterVm.inscricaoCadastral) : 0;
		obj.codigoProduto = this.filterVm.codigoProduto ? Number(this.filterVm.codigoProduto) : 0;

		this.applicationService.post("RelatorioListagemHistoricoInsumos", obj).subscribe((result:Array<RelatorioListagemHistoricoInsumosVM>)=>{
			if(result)
			{
				this.objetoRelatorio = result;
				tpExportacao == 1 ?
					this.exportPDF() :
						this.exportExcel();
			}
			else
			{
				this.modal.alerta("Nenhum registro encontrado", "Atenção!", "");
				return false;
			}
		})
	}

	exportExcel(){
		let nomeRelatorio = "Relatório Listagem do Histórico de Insumos da Listagem de Exportação";

		var excel : any = [];

		var jsonExcel : any = {};

		this.objetoRelatorio.forEach(element => {

			jsonExcel.LinhaVazia = [""]

			jsonExcel.Cabecalho = ["Empresa: " + element.nomeEmpresa, "Produto: " + element.codigoProduto + "-" + element.descricaoModelo, "", "", "", "", "", ""]

			excel.push(jsonExcel.Cabecalho);

			excel.push(jsonExcel.LinhaVazia);

			jsonExcel.CabecalhoRelatorio = [
				"Cód. Insumo",
				"Descrição Insumo",
				"Situação Insumo",
				"Descrição Tipo Alteração",
				"Justificativa",
				"Empresa",
				"Cód.Produto",
				"Desc.Produto"
			];

			if(!element.insumos)
			{
				jsonExcel.Na = ["PRODUTO NAO POSSUI INSUMOS CADASTRADOS!"]
				excel.push(jsonExcel.Na);
			}
			else
			{
				excel.push(jsonExcel.CabecalhoRelatorio);
				element.insumos.forEach(_insumo => {
					jsonExcel.itemHistoricoAnalise = [
						_insumo.codigoInsumo,
						_insumo.descricaoInsumo,
						_insumo.situacaoInsumo,
						_insumo.descricaoTipoAlteracao,
						_insumo.justificativa,
						element.nomeEmpresa,
						element.codigoProduto,
						element.descricaoModelo
					];
					excel.push(jsonExcel.itemHistoricoAnalise);
				});
			}
			excel.push(jsonExcel.LinhaVazia);
			excel.push(jsonExcel.LinhaVazia);
		});

		this.excelService.exportAsExcelFile(excel, nomeRelatorio, nomeRelatorio);
	}

	exportPDF()
	{
		this.parametros.columns = [
			"Cód. Insumo",
			"Descrição Insumo",
			"Situação Insumo",
			"Descrição Tipo Alteração",
			"Justificativa",
			"Empresa",
			"Cód.Produto / Desc.Produto"
		];
		this.parametros.fields = [
			"codigoInsumo",
			"descricaoInsumo",
			"situacaoInsumo",
			"descricaoTipoAlteracao",
			"justificativa",
			"empresa",
			"codProduto/DescProduto"
		];
		this.parametros.width = {
			0: { columnWidth: 50, fillColor: [255, 255, 255] },
			1: { columnWidth: 130, fillColor: [255, 255, 255] },
			2: { columnWidth: 70, fillColor: [255, 255, 255] },
			3: { columnWidth: 110, fillColor: [255, 255, 255] },
			4 :{ columnWidth: 130, fillColor: [255, 255, 255] },
			5 :{ columnWidth: 120, fillColor: [255, 255, 255] },
			6 :{ columnWidth: 120, fillColor: [255, 255, 255] }
		};

		let rows = Array<any>();

		let doc = new jsPDF('l', 'pt', 'a4');

		//doc.setFont('Calibri (Corpo)');
		doc.setFontType("bold");
		doc.setFontSize(15);
		doc.text("MINISTÉRIO DA ECONOMIA", 335, 85);

		doc.setFontSize(11);
		doc.text("SUPERINTÊNDENCIA DA ZONA FRANCA DE MANAUS", 294, 105);
		doc.text("SUFRAMA", 399, 125);

		doc.text('RELATÓRIO LISTAGEM DO HISTÓRICO DE INSUMOS DA LISTAGENS DE EXPORTAÇÃO', 200, 165);

		// #region Logo
		var imgData = 'data:image/jpeg;base64,';
		// #endregion
		doc.addImage(imgData, 'JPEG', 400, 10, 60, 60); //position: x, y, | width: x, y


		for (var _itemLista = 0; _itemLista < this.objetoRelatorio.length; _itemLista++)
		{
			if(this.objetoRelatorio[_itemLista].insumos!=null)
			{
				for (var _insumo = 0; _insumo < this.objetoRelatorio[_itemLista].insumos.length; _insumo++)
				{
					for (var coluna = 0 ; coluna < this.parametros.fields.length ; coluna++)
					{
						var objInsumo = this.objetoRelatorio[_itemLista].insumos[_insumo];

						rows[_insumo] = {
							0 : objInsumo.codigoInsumo,
							1 : objInsumo.descricaoInsumo,
							2 : objInsumo.situacaoInsumo,
							3 : objInsumo.descricaoTipoAlteracao,
							4 : objInsumo.justificativa,
							5 : this.objetoRelatorio[_itemLista].nomeEmpresa,
							6 : this.objetoRelatorio[_itemLista].codigoProduto + " / " + this.objetoRelatorio[_itemLista].descricaoModelo
						}
					}
				}

				doc.autoTable(this.parametros.columns, rows, {
					startY: 200,
					startX: 100,
					tableWidth: 'auto',
					headerStyles: {
						fillColor: [255, 255, 255],
						textColor: [0,0,0]
					},
					styles: {
						overflow: 'linebreak',
						valign: 'middle'
					},
					columnStyles: this.parametros.width
				});
			}
			else
			{
				doc.text("PRODUTO NÃO POSSUI INSUMOS CADASTRADOS!" , 405, 105);
			}
		}

		const addFooters = doc => {
			const pageCount = doc.internal.getNumberOfPages()
			doc.setFont('helvetica', 'italic')
			doc.setFontSize(8)
			for (var i = 1; i <= pageCount; i++) {
			  doc.setPage(i)
			  doc.text('Página ' + String(i) + ' de ' + String(pageCount), //texto
							doc.internal.pageSize.width / 2, //largura
							doc.internal.pageSize.height - 5, //altura
							{align: 'center'});
			}
		}
		addFooters(doc);

		doc.autoTableSetDefaults(null);
		doc.save('Relatório Listagem do Histórico de Insumos da Listagem de Exportação_'+new Date().getTime());

	}



}

